import React from "react";
import {
  ResponsiveContainer,
  PieChart,
  Pie,
  Cell,
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
  Legend,
} from "recharts";

const QUALITY_COLORS = {
  высокий: "#22c55e",
  хороший: "#16a34a",
  средний: "#facc15",
  низкий: "#f97316",
};

const Charts = ({ aggregations, loading }) => {
  if (!aggregations && !loading) return null;

  const {
    by_quality = [],
    by_model = [],
    by_date = [],
  } = aggregations || {};

  const pieData = by_quality.filter((q) => q.count > 0);

  const modelsData = [...by_model]
    .sort((a, b) => b.count - a.count)
    .slice(0, 10);

  const timeSeriesData = by_date;

  return (
    <div className="space-y-6 mb-6">
      {/* ===================== */}
      {/* TOP BLOCK */}
      {/* ===================== */}
      <div className="grid gap-6 lg:grid-cols-2">
        {/* PIE — Качество */}
        <div className="card p-4">
          <h2 className="mb-2 text-sm font-semibold text-slate-700">
            Распределение качества лидов
          </h2>

          <div className="h-64">
            {loading ? (
              <div className="flex h-full items-center justify-center text-sm text-slate-400">
                Загрузка данных...
              </div>
            ) : pieData.length === 0 ? (
              <div className="flex h-full items-center justify-center text-sm text-slate-400">
                Недостаточно данных
              </div>
            ) : (
              <ResponsiveContainer width="100%" height="100%">
                <PieChart>
                  <Pie
                    data={pieData}
                    dataKey="count"
                    nameKey="quality"
                    cx="50%"
                    cy="50%"
                    innerRadius={45}
                    outerRadius={85}
                  >
                    {pieData.map((entry) => (
                      <Cell
                        key={entry.quality}
                        fill={QUALITY_COLORS[entry.quality] || "#94a3b8"}
                      />
                    ))}
                  </Pie>
                  <Tooltip />
                  <Legend
                    verticalAlign="bottom"
                    iconType="circle"
                    wrapperStyle={{ fontSize: 12 }}
                  />
                </PieChart>
              </ResponsiveContainer>
            )}
          </div>
        </div>

        {/* BAR — Модели */}
        <div className="card p-4">
          <h2 className="mb-2 text-sm font-semibold text-slate-700">
            Лиды по моделям автомобилей
          </h2>

          <div className="h-64">
            {loading ? (
              <div className="flex h-full items-center justify-center text-sm text-slate-400">
                Загрузка данных...
              </div>
            ) : modelsData.length === 0 ? (
              <div className="flex h-full items-center justify-center text-sm text-slate-400">
                Недостаточно данных
              </div>
            ) : (
              <ResponsiveContainer width="100%" height="100%">
                <BarChart data={modelsData}>
                  <CartesianGrid strokeDasharray="3 3" vertical={false} />
                  <XAxis dataKey="model" tick={{ fontSize: 11 }} />
                  <YAxis allowDecimals={false} />
                  <Tooltip />
                  <Bar
                    dataKey="count"
                    fill="#22c55e"
                    radius={[4, 4, 0, 0]}
                  />
                </BarChart>
              </ResponsiveContainer>
